function filterData(){

    //chart format
    let the_data = {
        "price":{data:[], label:'Etherume'},
        "date":[]
    };

    let data =[];
    let date =[];
    for (i in jsonData){
        data.push(parseFloat(jsonData[i].Value));
        date.push(jsonData[i].Date);
    }
    the_data.price.data = data;
    the_data.date = date;

    return the_data;
}


